// message req
message AcceptCallReq{ 
		pb_rpc.Context reqCtx = 1;
		  int32 callID = 2 ;
		  CallProtocol protocol = 3 ;
		
}

message AcceptTermsOfServiceReq{ 
		pb_rpc.Context reqCtx = 1;
		  string termsOfServiceID = 2 ;
		
}

message AddChatMemberReq{ 
		pb_rpc.Context reqCtx = 1;
		  int64 chatID = 2 ;
		  int32 userID = 3 ;
		  int32 forwardLimit = 4 ;
		
}

message AddChatMembersReq{ 
		pb_rpc.Context reqCtx = 1;
		  int64 chatID = 2 ;
		  repeated int32 userIds = 3 ;
		
}

message AddFavoriteStickerReq{ 
		pb_rpc.Context reqCtx = 1;
		   
		InputFileAbsClass sticker = 2 ;
}

message AddLocalInfoReq{ 
		pb_rpc.Context reqCtx = 1;
		  int64 chatID = 2 ;
		  int32 senderUserID = 3 ;
		  int64 replyToInfoID = 4 ;
		  bool disableNotification = 5 ;
		   
		InputInfoContentAbsClass inputInfoContent = 6 ;
}

message AddNetworkStatisticsReq{ 
		pb_rpc.Context reqCtx = 1;
		   
		NetworkStatisticsEntryAbsClass entry = 2 ;
}

message AddProxyReq{ 
		pb_rpc.Context reqCtx = 1;
		  string server = 2 ;
		  int32 port = 3 ;
		  bool enable = 4 ;
		   
		ProxyTypeAbsClass typ = 5 ;
}

message AddRecentStickerReq{ 
		pb_rpc.Context reqCtx = 1;
		  bool isAttached = 2 ;
		   
		InputFileAbsClass sticker = 3 ;
}

message AddRecentlyFoundChatReq{ 
		pb_rpc.Context reqCtx = 1;
		  int64 chatID = 2 ;
		
}

message AddSavedAnimationReq{ 
		pb_rpc.Context reqCtx = 1;
		   
		InputFileAbsClass animation = 2 ;
}

message AddStickerToSetReq{ 
		pb_rpc.Context reqCtx = 1;
		  int32 userID = 2 ;
		  string name = 3 ;
		  InputSticker sticker = 4 ;
		
}

message AnswerCallbackQueryReq{ 
		pb_rpc.Context reqCtx = 1;
		  int64 callbackQueryID = 2 ;
		  string text = 3 ;
		  bool showAlert = 4 ;
		  string uRL = 5 ;
		  int32 cacheTime = 6 ;
		
}

message AnswerCustomQueryReq{ 
		pb_rpc.Context reqCtx = 1;
		  int64 customQueryID = 2 ;
